import logo from './logo.svg';
import './App.css';
import {BrowserRouter, Route, Routes} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/login'> </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
